import React from 'react';
import './App.css';

class Data extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        // length of shower
        // average shower time, how much longer/shorter this time
        // start, peak, delta humidity
        // start, peak, delta temp
        console.log(this.props)
        const {length, averageLength, diffFromAverage} = this.props.data;
        return (
            <div className="Data">
                <div className="data-row">
                    <div className="data-point">
                        <div className="data-point-large">{length}</div>
                        <div className="data-point-label">Length of shower</div>
                    </div>
                    <div className="data-point">
                        <div className="data-point-large">{diffFromAverage}</div>
                        <div className="data-point-label">{`${length > averageLength ? 'Longer':'Shorter'} than average`}</div>
                    </div>
                </div>
                <div className="data-row"></div>
                <div className="data-row"></div>
                <div className="data-row"></div>
                <div className="data-row"></div>
                <div className="data-row"></div>
            </div>
        );
    }
}

export default Data;

class DataPoint extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        const {data, label} = this.props;
        return(
            <div className="data-point">
                <div className="data-point-large">{data}</div>
                <div className="data-point-label">{label}</div>
            </div>
        )
    }
}
